import MarketingTitle from '@/views/pages/brand/marketing/components#/marketing-title'
import { TYPE } from '@/constants/marketing/plugin'
import tableMixin from '@/mixins/table.mixin'
import { columns } from './index.config'
import { IndexService } from './index.service'
/**
 * 使用枚举值 引入常量
 */
import { ACTIVITY_STATUS } from '@/constants/marketing/activity'

export default {
  bem: {
    // page-页面路由名称
    bPage: 'page-tpl-plugin-index'
  },
  components: {
    MarketingTitle
  },
  mixins: [tableMixin],
  serviceInject() {
    return {
      indexService: IndexService
    }
  },
  rxState() {
    /**
     * @type {IndexService}
     */
    const {
      activityStatusOptions$,
      list$,
      loading$,
      page$,
      auth$
    } = this.indexService
    return {
      activityStatusOptions$,
      list$,
      loading$,
      page$,
      auth$
    }
  },
  data() {
    return {
      TYPE,
      ACTIVITY_STATUS
    }
  },
  computed: {
    columns
  },
  methods: {
    onAdd() {
      this.$router.push({
        path: './add'
      })
    },
    onEdit(record) {
      this.$router.push({
        path: './edit',
        query: { id: record.id }
      })
    }
  }
}
